import axios from "axios";
const env = process.env.REACT_APP_BASE_URL

const API_URL = `${API_URL}`;

class ApiService {
  createNewAccount() {
    return axios.post(`${API_URL}/public/addNew/parent`);
  }
  getAPIUrl() {
    return API_URL;
  }
}

export default new ApiService();
